import {Container, Navbar} from "react-bootstrap";
import {Link} from "react-router-dom";

const Landing = () =>{
    return(
        <>
            <Navbar bg='dark' variant='dark'>
                <Container>
                    <Link to='/'>
                        <Navbar.Brand>Vaccine Hunting App</Navbar.Brand>
                    </Link>
                </Container>
            </Navbar>
        </>
    )
};

export default Landing;
